_Catppuccin for NixOS Search.css:
/*
==UserCSS==
@homepageURL https://github.com/dnordstrom
@version 1.0.0
@name Catppuccin for NixOS Search
@match *://search.nixos.org/*
@author Daniel Nordstrom <https://github.com/dnordstrom>
==/UserCSS==
*/

:root {
  /* Variables */

  --black0: hsl(254, 25%, 10%);
  --black1: hsl(249, 23%, 12%);
  --black2: hsl(240, 21%, 15%);
  --black3: hsl(249, 18%, 22%);
  --black4: hsl(254, 12%, 36%);
  --gray0: hsl(247, 8%, 46%);
  --gray1: hsl(274, 11%, 59%);
  --gray2: hsl(285, 10%, 75%);
  --white: hsl(220, 38%, 89%);
  --rosewater: hsl(10, 56%, 91%);
  --red: hsl(342, 79%, 75%);
  --yellow: hsl(041, 88%, 84%);
  --peach: hsl(024, 88%, 78%);
  --green: hsl(128, 58%, 79%);
  --lavender: hsl(238, 100%, 89%);
  --blue: hsl(207, 93%, 79%);
  --pink: hsl(316, 72%, 86%);
}

body {
  color: #fff;
  background-color: var(--black1);
}

a,
a:hover,
a:focus {
  color: var(--blue);
}

.navbar .nav a {
  color: #aaa !important;
  background-color: transparent !important;
}

.navbar .nav a:hover,
.navbar .nav a:focus,
.navbar .nav .active a {
  color: #fff !important;
  background-color: transparent !important;
}

.navbar-inner {
  background: var(--black0);
  border-bottom: 1px solid var(--black3);
}

.navbar .nav > li > a {
	text-shadow: none;
}

textarea,
input {
  color: #fff !important;
  background-color: var(--black1) !important;
  border: 1px solid var(--black3) !important;
}

.btn {
  background-color: var(--rosewater) !important;
}

.search-page > .search-results > div > :nth-child(2) > li.option > :nth-child(2) > div:nth-child(2n) pre {
  color: #fff;
}

.search-page > .search-results > div > :nth-child(2) > li {
  border-bottom: 1px solid var(--black3);
}

.search-page ul.search-sidebar > li {
  border: 1px solid var(--black3);
}

.search-page ul.search-sidebar > li > ul > li > a {
  color: var(--gray1);
}

.search-page > .search-results > div > :nth-child(2) > li.package .result-item-show-more {
  color: var(--gray1);
  background: var(--black0);
}

.nav-tabs > .active > a,
.nav-tabs > .active > a:hover,
.nav-tabs > .active > a:focus {
  color: var(--white);
  background-color: var(--black1);
  border: 1px solid var(--black3);
}

.nav-tabs {
  border-bottom: 1px solid var(--black3);
}

.nav-tabs > li > a:hover,
.nav-tabs > li > a:focus {
  border-color: var(--black3);
}

.nav > li > a:hover,
.nav > li > a:focus {
  background-color: var(--black3);
}

.search-page > .search-results > div > :nth-child(2) > li.package > :nth-child(5) > :nth-child(1) div.tab-content {
  border: 1px solid var(--black3);
}

code {
  color: var(--white);
  background-color: var(--black3);
  border: 1px solid var(--black3);
}

.search-page > .search-results > div > :nth-child(2) > li.package > :nth-child(5) > :nth-child(1) pre {
  background: var(--black3);
}

.search-page > .search-results > div > :nth-child(2) > li.option > :nth-child(2) > div:nth-child(2n) pre code {
  background: var(--black3);
}

